import { Button } from '@mui/material';
import { styled } from '@mui/system';
import React from 'react';

const MuiButton = styled(Button)({
    background:'linear-gradient(90deg,#FF8733 ,#FF9F33 )',
    padding:'.5rem',
    margintop: '1rem',
    color:'#fff',
    marginBottom:'1rem'
})


export default MuiButton;
